  `logistics_name` varchar(200) DEFAULT NULL COMMENT '物流公司名称',
  `is_eval` char(1) DEFAULT '0' COMMENT '是否评论(1:是0:否)',
  `sale_after_remarks` varchar(2000) DEFAULT NULL COMMENT '售后备注',
  `sale_after_date` datetime DEFAULT NULL COMMENT '售后申请时间',
  `remarks` varchar(600) DEFAULT NULL COMMENT '注备',
